import * as React from 'react';
import { Button, View, Text } from 'react-native';

export const Home = ({ navigation, route }) => {
    return (
        <View>

            <Button
                title="Go to screen1"
                onPress={() => {
                    /* 1. Navigate to the Details route with params */
                    navigation.navigate('screen1', {
                        etudiant: {
                            id: 80, nom: 'Gompou'
                        }


                    });
                }}
            />

        </View>
    );
}
